import React from "react";

const Header = ({ titulo, handleOnClick, props }) => {
  const { showButtom } = props;
  return (
    <div className="header">
      <h1>{titulo}</h1>
      {showButtom && <button onClick={handleOnClick}>Agregar</button>}
    </div>
  );
};

Header.defaultProps = {
  showButtom: false,
};
export { Header };
